app.delete("/auth/templaste/:id", (req, res) => {
  const templateId = req.params.id;

  // Find the index of the template to delete
  const index = responseData.data.findIndex((item) => item.id === templateId);

  if (index !== -1) {
    // Remove the template from the array
    responseData.data.splice(index, 1);
    return res.status(200).json({ message: "Template deleted successfully" });
  } else {
    return res.status(404).json({ error: "Template not found" });
  }
});

