app.get("/auth/products", (req, res) => {
  const { search, category } = req.query;
  console.log("selectedCategory: ", category);

  // Start with the full list of products
  let filteredProducts = products;

  // Filter products by category if selectedCategory is provided
  if (category) {
    filteredProducts = filteredProducts.filter(
      (product) => product.category === category
    );
  }

  // Further filter products by search term if provided
  if (search) {
    filteredProducts = filteredProducts.filter((product) =>
      product.name.toLowerCase().includes(search.toLowerCase())
    );
  }

  // Send the filtered products directly without merging into arrays by category
  res.json(filteredProducts);
});

app.get("/auth/products/suggestion", (req, res) => {
  const { search, category } = req.query;
  console.log("selectedCategory: ", category);

  let filteredProducts = products;

  // Filter products by category if selectedCategory is provided
  if (category) {
    filteredProducts = filteredProducts.filter(
      (product) => product.category === category
    );
  }

  // Further filter products by search term if provided
  if (search) {
    filteredProducts = filteredProducts
      .filter((product) =>
        product.name.toLowerCase().includes(search.toLowerCase())
      )
      .map((product) => product.name); // Only return product names
  }

  // Return the filtered list
  if (search) {
    res.json(filteredProducts);
  } else {
    res.json();
  }
});

app.post("/auth/products", (req, res) => {
  const newProduct = req.body; // Expecting { id, name, price, category, image }
  console.log("newProduct: ", newProduct);

  // Validate new product data
  if (!newProduct.name || !newProduct.price || !newProduct.category) {
    return res.status(400).json({ message: "Missing required fields" });
  }

  // Add the new product to the products array
  products.push(newProduct);
  res.status(201).json(newProduct);
});

app.post("/auth/send_template", (req, res) => {
  console.log(req);
  return res.status(200).json();
});

app.put("/auth/products/:id", (req, res) => {
  const productId = parseInt(req.params.id);
  console.log("req.params.id: ", req.params.id);
  const updatedProduct = req.body;

  const index = products.findIndex((product) => product.id === productId);

  if (index !== -1) {
    products[index] = { ...products[index], ...updatedProduct };
    console.log("products[index] : ", products[index]);
    res.status(200).json(products[index]);
  } else {
    res.status(404).json({ message: "Product not found" });
  }
});

